import React from 'react';

const Header = () => {
    return (
        <header>
            <nav>
                <a href='#'>Hotel Name</a>
                <a href='#'>Rooms</a>
                <a href='#'>Rest</a>
            </nav>
        </header>
    )
}

export default Header;
